function SiteFooterBottom() {
    return (
        <div className="site-footer__bottom">
        <div className="container">
          <p>@ All copyright 2021, dulichphutho.vn</p>
          <div className="site-footer__social" />
        </div>
      </div>
    )
}

export default SiteFooterBottom
